package sravya1;

public class Loop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int i;
		for(i=1;i<=10;i++)// print 1 to 10
		{
			System.out.println(i);
		}
		for(int x=10;x>=1;x--)// print 10 to 1
		{
			System.out.println(x);
		}
		for(int z=1;z<=10;z++)// print 1 to 10 except 6
		{
			if(z!=6)
			{
			System.out.println(z);
		}
	}

}
}
